import * as React from 'react';
import Props from './props';

import CephDropzone from 'components/CephDropzone/connected';
// import TracingViewer from 'components/TracingViewer/connected';
import TracingToolbar from 'components/TracingToolbar/connected';

import Zoomable from 'components/Zoomable';

const style: React.CSSProperties = {
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: 'white',
};

const imageSrc = 'data:image/png;base64,'

class TracingViewer extends React.Component<any, any> {
  state = {
    originX: 0,
    originY: 0,
    scaleFactor: 1,
  };

  handleZoom = (scaleFactor: number, originX: number, originY: number) => {
    this.setState({ scaleFactor, originX, originY });
  }

  render() {
    const { className } = this.props;
    const { ...rest } = this.state;
    return (
      <Zoomable {...rest} onZoom={this.handleZoom} >
        <svg className={className} style={style}>
          <image xlinkHref={imageSrc} />
        </svg>
      </Zoomable>
    );
  }
};

const classes = require('./style.scss');

export default class TracingEditor extends React.PureComponent<Props, { }> {
  render() {
    const {
      imageId,
      className,
      onFilesDrop,
      isDemoImageLoading,
      onDemoButtonClick,
    } = this.props;
    return (
      <div className={className}>
        {(imageId !== null) ? (
          <TracingViewer
            className={classes.main}
            imageSrc={imageId}
          />
        ) : (
          <CephDropzone
            onFilesDrop={onFilesDrop}
            onDemoButtonClick={onDemoButtonClick}
            isDemoImageLoading={isDemoImageLoading}
            className={classes.main}
          />
        )}
        <TracingToolbar className={classes.toolbar} imageId={imageId} />
      </div>
    );
  }
}
